import React from 'react';

const ExecutionControl = ({ onRun, onStop }) => {
  return (
    <div className="panel">
      <h2>Execution Control</h2>
      <button onClick={onRun} className="btn-primary">Run Tests</button>
      <button onClick={onStop} className="btn-secondary">Stop Tests</button>
    </div>
  );
};

export default ExecutionControl;
